@MrLondon & @Alice.Sampo explore the stunning 40 acre plantation which dates back to the 1830’s, which is totally free, great for kids and dog friendly! 🐶🐾 @BellaInLondon enjoyed the bluebells... and for any keen gardeners there’s also a national collection of Wilson’s 50 Kurume Azaleas from Japan 🇯🇵, along with rhododendrons, camellias, streams, bogs, heather gardens, glades and ponds. We’re truly spoilt having this in London... so try and get there today, or next week. Don’t worry if it showers, hide under a willow tree and shoot the rain in slow motion! ☔️☀️☺️ Lovely to hang with @itsjasonfrazer also! Top man! ❤️
