@MrLondon & @Alice.Sampo taking a little ride on the bikes today and we wanted to swing by the palace and see the tributes being left by well-wishers as the nation contemplates the passing of #PrincePhillip yesterday. 💔 It was lovely to chat to some of the Londoners who came to pay tribute, as we took a look around the grounds. Have a lovely day everyone. ❤️🙏🏼
