@MrLondon & @Alice.Sampo throwback to 2019! 🥰 We LOVE cycling around London and filming it in 360 is a lot of fun! ☺️ We cycled #OxfordStreet to #HydePark via #MarbleArch. ⏩ Then grabbed a taxi past #BuckinghamPalace and over to #TrafalgarSquare. ⏩ And then we rode the top deck of a new bus via #PiccadillyCircus and poked our camera out the little side window! 🤪🤪 Super cool view down #RegentStreet. 😎  Hope you enjoy and are excited for London to return to some kind of normality! ❤️

